import React from "react";
import "../css/App.css";

class Header extends React.Component {
  render() {
    return (
      <div className="nav">
        <span className="menu">
          <a href="" onclick="openMenu()">
            <i class="fas fa-bars" />
          </a>
        </span>

        <div className="menu">
          <a href="" onclick="closeMenu()">
            <i class="fas fa-times" />
          </a>
        </div>
      </div>
    );
  }
}

export default Header;
